import React, { useState } from "react";
import { Calendari } from "./style";


function OrganizarSemana(diaSemana: any, setData: any) {
  let domingo: any = [];
  diaSemana.forEach((element: string) => {
    domingo.push(<li onClick={() => setData(count - 1)}>{element}</li>);
  });
  return domingo;
}

export default function Calendario(dias: any) {
  let domingo, segunda, terca, quarta, quinta, sexta, sabado: any;
  domingo = OrganizarSemana(dias.dias[0], dias.setData);
  segunda = OrganizarSemana(dias.dias[1], dias.setData);
  terca = OrganizarSemana(dias.dias[2], dias.setData);
  quarta = OrganizarSemana(dias.dias[3], dias.setData);
  quinta = OrganizarSemana(dias.dias[4], dias.setData);
  sexta = OrganizarSemana(dias.dias[5], dias.setData);
  sabado = OrganizarSemana(dias.dias[6], dias.setData);



  return (
    <>
      <Calendari>
        <ul>
          {domingo}
        </ul>
        <ul>
          {segunda}
        </ul>
        <ul>
          {terca}
        </ul>
        <ul>
          {quarta}
        </ul>
        <ul>
          {quinta}
        </ul>
        <ul>
          {sexta}
        </ul>
        <ul>
          {sabado}
        </ul>
      </Calendari>
    </>
  );


}
